  -khtml-user-select: none;
  -moz-user-select: none;
  -ms-user-select: none;
  user-select: none;
  white-space: normal;
  text-align: left;
  line-height: normal;
}

#coi-banner-wrapper h2 {
  font-size: 18px;
  margin-bottom: 10px;
}

#coi-banner-wrapper ul,
#coi-banner-wrapper p {
  font-size: 14px;
  margin-bottom: 20px;
}

#coi-banner-wrapper a {
  font-size: 14px;
  text-decoration: underline;
  font-weight: bold;
  color: #0073ab;
}

#coi-banner-wrapper a:hover {
  text-decoration: none;
}

#coiOverlay {
  background: rgba(0, 0, 0, 0.7);
  display: flex;
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  justify-content: center;
  align-items: center;
  z-index: 99999999999;
  padding: 20px;
  box-sizing: border-box;
}

#coiOverlay,
#coiOverlay button {
  font-family: "Maersk Text", -apple-system, BlinkMacSystemFont, Microsoft JhengHei, Microsoft Yahei, 微软雅黑, STXihei, 华文细黑, sans-serif;
}

.coi-banner__wrapper {
  width: 700px;
  /* width: 976px; */
  max-width: 100%;
  max-height: 100%;
  background: #fff;
  overflow-x: hidden;
  border-radius: 5px;
}

.coi-banner__wrapper::-webkit-scrollbar-thumb {
  background-color: #ccc !important;
  border-radius: 5px;
}

.coi-banner__wrapper::-webkit-scrollbar-track {
  background-color: none;
}

.coi-banner__wrapper::-webkit-scrollbar {
  width: 6px;
  background-color: #f5f5f5;
  border-radius: 2px;
}

.coi-banner__page {
  flex: 1;
  flex-direction: column;
  align-items: flex-end;
  display: block;
}

.coi-banner__page__content {
  padding: 24px;
}

/* 
#coiConsentBannerCategoriesWrapper,.coi-banner__summary {
  background: #f6f6f6;
} */
/* .coi-banner__summary {
  flex: 4;
} */
#coiConsentBannerCategoriesWrapper,
.coi-banner__cookiedeclaration,
.coi-banner__privacycontrols,
.coi-banner__summary {
  color: #222;
  width: 100%;
}

#coiConsentBannerCategoriesWrapper {
  padding: 24px;
}

.coi-banner__header {
  display: flex;
  width: 100%;
  justify-content: space-between;
  align-items: center;
  flex-direction: row;
  padding: 24px;
  background: #fff;
  border-bottom: 1px solid #cfcfcf;
}

.coi-banner__header img {
  max-width: 100%;
}

.coi-banner__header a {
  font-size: 12px !important;
  text-decoration: none !important;
}

.coi-banner__discription {
  padding: 24px;
  padding-bottom: 0;
  display: block;
}

.coi-banner__text {
  font-size: 18px;
  line-height: 20px;
  padding: 24px;
}

.coi-banner__maintext {
  line-height: 20px;
  font-size: 16px;
}

.coi-banner__headline {
  font-family: "Maersk Text", -apple-system, BlinkMacSystemFont, Microsoft JhengHei, Microsoft Yahei, 微软雅黑, STXihei, 华文细黑, sans-serif;
  color: #222;
  font-weight: normal;
  display: block;
  font-size: 26px;
  line-height: 1.2em;
  margin-bottom: 10px;
}

.coi-banner__header .coi-banner__branding {
  font-size: 9px;
  color: #666;
  opacity: 0;
  display: none;
}

.coi-banner__header .coi-banner__branding a {
  display: block;
  text-decoration: none !important;
  color: #555 !important;
  font-size: 10px;
  font-weight: bold;
}

.coi-banner__page-footer {
  background: #fff;
  width: 100%;
  /* flex: 0; */
  display: flex;
  justify-content: space-between;
  padding: 24px;
  bottom: 0;
  z-index: 99999;
  border-top: 1px solid #cfcfcf;
  position: sticky;
}

.coi-banner__accept,
.coi-banner__lastpage,
.coi-banner__nextpage {
  color: #222;
  padding: 9px 25px;
  text-align: center;
  cursor: pointer;
  font-size: 15px;
  -webkit-touch-callout: none;
  -webkit-user-select: none;
  -khtml-user-select: none;
  -moz-user-select: none;
  -ms-user-select: none;
  user-select: none;
  display: flex;
  align-items: center;
  justify-content: center;
  border-radius: 5px;
  max-width: 50%;
  margin: 0;
  border: 0;
  background: none;
}

.coi-banner__nextpage--push {
  margin-left: auto;
}

.coi-banner__lastpage,
.coi-banner__nextpage {
  border: solid 2px #00233d;
  text-transform: uppercase;
  border-radius: 2px;
  color: #00233d;
  background: #fff;
}

.coi-banner__lastpage:hover,
.coi-banner__nextpage:hover {
  color: #00233d;
  background: rgba(0, 35, 61, 0.1);
}

#coi-banner__selectAll {
  color: #222;
  padding: 10px 25px;
  text-align: center;
  cursor: pointer;
  font-size: 15px;
  user-select: none;
  display: block;
  border-radius: 2px;
  border: 0;
  float: right;
}

.coi-banner__accept,
#coi-banner__selectAll {
  text-transform: uppercase;
  background: #00243d;
  color: #fff;
  border-radius: 2px;
  text-decoration: none;
  margin-left: auto;
}

.coi-banner__accept--fixed-margin {
  margin-left: 20px;
}

.coi-banner__accept:hover,
#coi-banner__selectAll:hover {
  background: #004070;
}

.coi-banner__accept:focus,
#coi-banner__selectAll:focus {
  background: #004070;
  box-shadow: inset 0 0 0 2px #fff;
}

.coi-consent-banner__categories-wrapper {
  box-sizing: border-box;
  position: relative;
}

.coi-consent-banner__category-container {
  display: flex;
  flex-direction: column;
  border-top: 1px solid #cfcfcf;
  padding: 14px 0;
}

.coi-consent-banner__name-container {
  position: relative;
  display: flex;
  color: #272727;
  padding-right: 50px;
}

.coi-consent-banner__category-name {
  position: relative;
}

.coi-consent-banner__name-container__label {
  font-size: 20px;
  word-break: break-word;
  cursor: pointer;
  color: #0073ab;
}

.coi-consent-banner__name-container__number {
  background: #e5e5e5;
  border-radius: 20px;
  min-width: 22px;
  display: inline-block;
  text-align: center !important;
  font-size: 14px;
  padding: 2px 0;
  margin-left: 10px;
}

.coi-consent-banner__no-cookies {
  margin: 0;
  font-size: 1em;
}

.coi-consent-banner__category-name span {
  /* margin-bottom: 30px; */
  /* min-width: 110px;
  max-width: 110px; */
}

.coi-consent-banner__category-expander:checked ~ .coi-consent-banner__name-container,
.coi-consent-banner__category-name:hover {
  color: #000;
}

.coi-consent-banner__category-expander {
  position: absolute;
  opacity: 0;
  z-index: -1;
}

.coi-consent-banner__category-expander:focus + .coi-consent-banner__name-container {
  outline: solid 1px #42b0d5;
}

.coi-consent-banner__switch-container {
  margin-left: 10px;
  position: absolute;
  top: 0;
  right: 0;
}

.coi-checkboxes {
  position: relative;
  display: flex;
}

.coi-checkboxes input {
  opacity: 0 !important;
  position: absolute;
  width: 100%;
  height: 100%;
  z-index: 1;
}

.coi-checkboxes input:focus + .checkbox-toggle {
  outline: solid 2px #42b0d5;
}

.coi-checkboxes .checkbox-toggle {
  background: #aaa;
  width: 40px;
  height: 24px;
  float: left;
  border-radius: 12px;
  position: relative;
  cursor: pointer;
  transition: 0.3s ease;
}

.coi-checkboxes input[type=checkbox]:checked + .checkbox-toggle {
  background: #42b0d5;
}

.coi-checkboxes input[type=checkbox]:checked + .checkbox-toggle:before {
  left: 19px;
  background: #fff;
}

.coi-checkboxes .checkbox-toggle:before {
  transition: 0.3s ease;
  content: "";
  width: 16px;
  height: 16px;
  position: absolute;
  background: #fff;
  left: 5px;
  top: 4px;
  box-sizing: border-box;
  color: #333;
  border-radius: 50%;
}

.coi-consent-banner__description-container {
  max-height: 0;
  width: 100%;
  transition: all 0.3s ease-in-out;
  align-self: flex-end;
  overflow: hidden;
