        <span class="coi-banner__headline">Cookie declaration</span>
        <div class="coi-top-column">
            <span class="top-column__bold-text">Your consent applies to the following domains:</span>
            <span class="top-column__website-domains">maersk.com, beta.maersk.com.cn, maersk.com.cn, beta.maersk.com</span>
            <span class="top-column__bold-text">Cookie declaration last updated on 23.03.2024</span>
