          <div class="coi-bottom-column">
            <div class="bottom-column__why-cookies"><h2>What is a cookie?</h2>

<p>A cookie is a small datafile that is saved on your computer, tablet or mobile phone. A cookie is not a program that can contain harmful programs or viruses.</p> 

<h2>How/why the homepage uses cookies</h2>

<p>Cookies are necessary for the homepage to function. Cookies help us get an overview of your visit to the homepage so that we can continually optimise and adjust the homepage to your requirements and interests. For example, cookies remember what you might have added to a shopping cart, if you have previously visited the page, if you are logged in and what languages and currency you want displayed on the homepage. We also use cookies to target our ads to you on other homepages. On a very general level, cookies are used as part of our services in order to show content that is as relevant as possible to you.</p>

<h2>How long are cookies saved?</h2>

<p>How long cookies are saved on your device can vary. The time when they are scheduled to expire is calculated from the last date you visited the homepage. When cookies expire, they are automatically deleted. You can view a complete list cookies below.</p>

<h2>This is how you can reject or delete your cookies</h2>

<p>You can always reject cookies on your computer, tablet or phone by changing your browser settings. Where these settings can be found depends on the type of browser you are using. If you do change the settings, please be aware that there will be some functions and services that you cannot use because they rely on the homepage being able to remember the choices you have made.<br>

You can choose to not receive cookies from Google Analytics <a href="https://tools.google.com/dlpage/gaoptout" target="_blank" data-di-id="di-id-4dacf2e0-ffbbd800">here</a>.<br>
</p>

<h2>Deleting cookies</h2>

<p>You can delete cookies that you have previously accepted. If you are using a PC with a recent version of a browser, you can delete your cookies by using these shortcut keys: CTRL + SHIFT + Delete.</p>

<p>If the shortcut keys do not work and/or you are using an Apple computer, you must find out what browser you are using and then click on the relevant link:</p>

<ul>
<li><a href="https://support.microsoft.com/en-us/help/17442/windows-internet-explorer-delete-manage-cookies#ie=ie-11" target="_blank" data-di-id="di-id-8c50d89e-24b318e7">Internet Explorer</a></li>
<li><a href="https://support.mozilla.org/en-US/kb/delete-cookies-remove-info-websites-stored" target="_blank" data-di-id="di-id-5ffe3c-a1af534">Mozilla Firefox</a></li>
<li><a href="https://support.google.com/chrome/answer/95647?hl=en" target="_blank" data-di-id="di-id-1c9546f4-e946b48e">Google Chrome</a></li>
<li><a href="https://www.opera.com/help/tutorials/security/cookies" target="_blank" data-di-id="di-id-bb4a3477-2a2b415c">Opera</a></li>
<li><a href="https://support.apple.com/en-us/HT201265" target="_blank" data-di-id="di-id-71088e22-9a6a3264">Safari</a></li>
<li><a href="https://www.macromedia.com/support/documentation/en/flashplayer/help/settings_manager07.html" target="_blank" data-di-id="di-id-d3621c43-8a36cf9c">Flash cookies</a></li>
<li><a href="https://support.apple.com/en-us/HT1677" target="_blank" data-di-id="di-id-b661db03-5e580b98">Apple</a></li>
<li><a href="https://timeread.hubpages.com/hub/How-to-delete-internet-cookies-on-your-Droid-or-any-Android-device" target="_blank" data-di-id="di-id-9e4d2963-d16bd119">Android</a></li>
<li><a href="https://support.microsoft.com/en-us/help/11696/windows-phone-7" target="_blank" data-di-id="di-id-14d71550-f5d007cc">Windows 7</a></li>
</ul>


<p>Remember: If you are using several different browsers, you must delete the cookies in all of them.</p>

<h2>Do you have any questions?</h2>

<p>Should you have any questions or comments in connection with this information and/or our processing of personal data, you are welcome to get in touch with us. The cookie declaration itself is updated every month via <a href="https://cookieinformation.com/" target="_blank" data-di-id="di-id-939f8923-421e78f3">Cookie Information</a>. If you have any questions regarding the Cookie Information, you can send an email to info@cookieinformation.com.</p>

<p>Please read the Cookie Policy <a href="https://terms.maersk.com/cookies" target="_blank" data-di-id="di-id-4b9821be-c8b0c5c9">here</a>.<br>
</p>
